import React from 'react';

function ManageFertilizers() {
  return (
    <div>
      <h2>Manage Fertilizers</h2>
      <ul>
        <li>Add New Fertilizer</li>
        <li>Update Stock</li>
        <li>Modify Details</li>
      </ul>
    </div>
  );
}

export default ManageFertilizers;
